import React from 'react';
import AddUser from './components/Users/AddUser';
import UserList from './components/Users/UsersList';

const users =[
{id: 1, name: 'toto', age:23}
];
function App() {
  return (
    <div>
      <AddUser />
      <UsersList users={users}/>
    </div>
  );
}

export default App;
